import React from 'react';

import styled from 'styled-components';

import { ViewerSettingItemStyle } from '../../styles/viewer';

const Container = styled.div`
  ${ViewerSettingItemStyle}
`;

interface Props {
  label: string;
  value: number | string;
  colors: string[];
  action: (param: string | number) => void;
}

const ViewerSettingColorItem: React.FunctionComponent<Props> = ({ label, value, colors, action }) => {
  return (
    <Container>
      <Label>
        {label}
      </Label>
      <Value>
        {value}
      </Value>
      <Controller>
        <MinusButton onClick={countDownValue}>
          -
        </MinusButton>
        <PlusButton onClick={countUpValue}>
          +
        </PlusButton>
      </Controller>
    </Container>
  )
};

export default ViewerSettingColorItem;
